import React from 'react';
import CustomNavbar from '../components/CustomNavbar';
import Breadcrumb from '../components/Breadcrumb';
import FooterTwo from '../components/Footer/FooterTwo';
import FooterData from '../components/Footer/FooterData';
import Partner from '../components/Partner';


const Dermatologia = () => {
    return(
        <div className="body_wrapper">
            <CustomNavbar slogo="sticky_logo" mClass="menu_tracking" nClass="w_menu ml-auto mr-auto"/>
            <Breadcrumb breadcrumbClass="breadcrumb_area" imgName="breadcrumb/banner_bg.png" Ptitle="Dermatologia" Pdescription=""/>
            <div class="row mb-3 pl_100 pr_100 mt_100 mb_100">
            <div class="col-lg-6">
            <h3 className='text-center'>Objetivo:</h3>
                <p className='text-justify'>DIF Jocotepec tiene el propósito e intención de crear una cultura de prevención y atención oportuna en cuanto a enfermedades bucodentales asi como generar hábitos de higiene ofreciendo servicios dentales a bajo costo, como consultas odontológicas, extracciones, limpiezas dentales y obturaciones con resina; además de ofrecer servicios especializados realizados por especialistas pensando siempre en el beneficio para la población de bajos recursos.</p>
            </div>
            <div class="col-lg-6 text-center">
                <div>
                <h3>Costo:</h3>
                <p>$80.00 pesos Mx</p>
                <h3>Dirección:</h3>
                <a>Donato Guerra oriente #22</a>
                <h3>Horario:</h3>
                <p> 8:00 a 14:30pm</p>
                <h3>Teléfono:</h3>
                <a>387 763 2931</a>
                <p className='text-justify'> *Los costos del tratamiento pueden variar dependiendo de la situación especifica de cada paciente*</p>
                </div>
            </div>
            </div>
            <div className='row'>
            <div className='container text-center pt_160 sec_pad_b'>
                <h3>Mapa del centro de atención:</h3>
            <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3742.3369660319595!2d-103.43261758507965!3d20.28631488640522!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x842f5bf570930269%3A0x1ece9fa45e10c2dc!2sC.%20Hidalgo%20Eje%20Sur%206%2C%20Jocotepec%20Centro%2C%2045800%20Jocotepec%2C%20Jal.!5e0!3m2!1ses!2smx!4v1652996368960!5m2!1ses!2smx" width="600" height="450"></iframe>
            </div>
            </div>
            <Partner pClass="partner_logo_area_two" pClasst="pt-0 mb-0"/>{/**esta es la parte de los logos de la dependencia */}
            <FooterTwo fClass="pt_150" FooterData={FooterData}/>

        </div>

    );

}

export default Dermatologia;
